import React from "react";
import IconGallery from "../IconGallery";
import SupportNav from "../SupportNav";
import "./style.css";

function WhiteHead() {
  return (
    <div id="inner-white-bar">
        <IconGallery />
        <SupportNav />
    </div>
  );
}

export default WhiteHead;
